import Client from "../client/client";

const baseUrl = `‫‪http://uitestapi.tipax.ir/api/v1‬‬`;

function user() {
  return {
    login: ({ params, payload }) => {
      const url = baseUrl + "/‫‪Users/Token‬‬";
      return Client.post(url, payload, {});
    },
  };
}

export default user();
